// JSX = JS XML
// Bable is used to convert React code into browser code
import React from "react"; // "react" is import to use html tags in JS (JSX) 
import ReactDOM from "react-dom";

// To render multiple html elements in React we will write inside a div but it increase our no of lines of code. we don't need divs instead we will use React.Fragment

//save compile time and memory
ReactDOM.render(
  <React.Fragment>
    <h1>Hello World!</h1>
    <p> hii</p>
    <list>
      <ol>
        <li>One</li>
        <li>Two </li>
        <li>Three</li>
      </ol>
    </list>
  </React.Fragment>,
   document.getElementById("root"));
